// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IHederaTokenService {
    function transferNFT(address token, address sender, address receiver, int64 serialNumber) external returns (int64 responseCode);
}

contract NFTSale {
    address public owner;
    address public treasury;
    address public tokenAddress;
    uint256 public price = 50 * 10**8;
    uint256 public maxSupply = 100;
    uint256 public soldSupply = 0;
    uint256 public currentTokenId = 2;

    address constant precompileAddress = address(0x167);
    IHederaTokenService private hederaTokenService;

    mapping(address => bool) public hasPurchased;

    // Events for tracking every step
    event PurchaseInitiated(address buyer, uint256 value);
    event NFTSold(address indexed buyer, uint256 serialNumber);
    event TransferAttempt(address token, address from, address to, uint256 serialNumber);
    event TransferResponse(int64 responseCode);
    event StateUpdate(uint256 newTokenId, uint256 newSoldSupply);
    event PaymentReceived(address from, uint256 amount);

    constructor(address _tokenAddress, address _treasury) {
        owner = msg.sender;
        tokenAddress = _tokenAddress;
        treasury = _treasury;
        hederaTokenService = IHederaTokenService(precompileAddress);
        emit ContractInitialized(msg.sender, _tokenAddress, _treasury);
    }
    event ContractInitialized(address owner, address token, address treasury);

    function purchaseNFT() external payable {
        emit PurchaseInitiated(msg.sender, msg.value);

        require(msg.value == price, "Incorrect payment amount");
        require(soldSupply < maxSupply, "All NFTs sold out");
        require(!hasPurchased[msg.sender], "You have already purchased");
        require(currentTokenId <= 100, "No more NFTs available");

        uint256 serialToTransfer = currentTokenId;

        emit PaymentReceived(msg.sender, msg.value);
        emit TransferAttempt(tokenAddress, treasury, msg.sender, serialToTransfer);

        int64 response = hederaTokenService.transferNFT(
            tokenAddress,
            treasury,
            msg.sender,
            int64(uint64(serialToTransfer))
        );

        emit TransferResponse(response);
        require(response == 0, string(abi.encodePacked("HTS Precompile Error: ", response)));

        currentTokenId++;
        soldSupply++;
        hasPurchased[msg.sender] = true;

        emit StateUpdate(currentTokenId, soldSupply);
        emit NFTSold(msg.sender, serialToTransfer);
    }

    function withdrawFunds() external {
        require(msg.sender == owner, "Not authorized");
        emit WithdrawInitiated(msg.sender, address(this).balance);
        payable(owner).transfer(address(this).balance);
        emit WithdrawCompleted(msg.sender, address(this).balance);
    }
    event WithdrawInitiated(address owner, uint256 amount);
    event WithdrawCompleted(address owner, uint256 amount);
}

